import React, { Component } from 'react';
import PropTypes from 'prop-types';
import classNames from 'classnames';
import { withStyles } from '@material-ui/core/styles';

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    height:'100vh',
    backgroundColor: 'red',
  },
  root: {
    maxWidth: '100%',
    flexGrow: 1,
    marginTop: '80px',
  },
  containerHeader: {
    display: 'flex',
    padding: '0 8px',
    alignItems: 'center',
    justifyContent: 'space-between',
    marginBottom: '16px',
    color: 'white !important',
    fontWeight: 'none',
background: '-moz-linear-gradient(45deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%)',
background: '-webkit-gradient(linear, left bottom, right top, color-stop(0%, rgba(153,186,87,1)), color-stop(100%, rgba(230,240,225,1)))',
background: '-webkit-linear-gradient(45deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%)',
background: '-o-linear-gradient(45deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%)',
background: '-ms-linear-gradient(45deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%)',
background: 'linear-gradient(45deg, rgba(153,186,87,1) 0%, rgba(230,240,225,1) 100%)',
  },
});

class error404 extends Component {

  render(){
    const { classes } = this.props;

    return(
      <div>
      <div className={classes.container}>
      <h1>Hola, soy el error 404</h1>
      </div>
      </div>
      );
  }
}
error404.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(error404);
